"original": |2-
     The state machine is initialized in the "Trying" state and is passed
     a request other than INVITE or ACK when initialized.  This request is
     passed up to the TU.  Once in the "Trying" state, any further request
     retransmissions are discarded.  A request is a retransmission if it
     matches the same server transaction, using the rules specified in
     Section 17.2.3.
"fixed": |-
  The state machine is initialized in the "Trying" state and is passed a request other than INVITE or ACK when initialized.  This request is passed up to the TU.  Once in the "Trying" state, any further request retransmissions are discarded.  A request is a retransmission if it matches the same server transaction, using the rules specified in Section 17.2.3.
"ko": |-
  상태 머신은 "Trying" 상태로 초기화되며 초기화 시 INVITE 또는 ACK 이외의 요청이 전달됩니다. 이 요청은 TU로 전달됩니다. "시도 중" 상태가 되면 추가 요청 재전송은 모두 삭제됩니다. 섹션 17.2.3에 지정된 규칙을 사용하여 동일한 서버 트랜잭션과 일치하는 경우 요청은 재전송입니다.
